  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:18.563621\",\n\t\"name\": \"horicon-national-wildlife-refuge-narrative-report-may-august-1954\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Horicon National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1954.
  The report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical development and plantings. Resource management
  is outlined; topics include grazing, and haying. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, and Refuge participation. N-R forms
  and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
